import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply Price Sort Filter
    await page.waitForSelector('.sort-controls select');
    await page.selectOption('.sort-controls select', 'price-low');
    await page.waitForTimeout(1000); // Wait for the products to be sorted

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sorted.png'));

    // Extracting data to verify task completion
    const sortedProducts = await page.$$eval('.product-card', cards => {
      return cards.map(card => ({
        title: card.querySelector('.product-title').innerText,
        price: parseFloat(card.querySelector('.product-price').innerText.replace('$', ''))
      }));
    });

    return {
      success: true,
      action: "Applied price sort filter and took screenshots",
      extractedData: { sortedProducts },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
